import React from "react";
import './Pagination.css'

function Pagination() {
    return (
        <>
            <nav aria-label="pagination">
                <ul className="pagination">
                    <li><a href=""><span aria-hidden="true">«</span>
                                  <span className="visuallyhidden">previous set of pages</span></a></li>
                    <li><a href=""><span class="visuallyhidden">page </span>1</a></li>
                    <li><a href=""><span class="visuallyhidden">page </span>2   </a></li>
                    <li><a href=""><span class="visuallyhidden">next set of pages</span><span aria-hidden="true">»</span></a></li>
                </ul>
            </nav>
        </>
    );
}

export default Pagination;
